  false,\n\t\"url\": null,\n\t\"notes\": \"The State of the Climate is a collection
  of periodic summaries recapping climate-related occurrences on both a global and
  national scale. The State of the Climate Monthly Overview - Global El Niu00c3u00b1o/Southern
  Oscillation report describes atmospheric and oceanic conditions related to ENSO,
  a periodic fluctuation in sea surface temperature (El Niu00c3u00b1o) and the air
  pressure of the overlying atmosphere (Southern Oscillation) across the equatorial
  Pacific Ocean. Each report provides a status statement and descriptions of the following
  indicators: 1) Sea surface temperatures (SSTs) and mixed-layer conditions; 2) Equatorial
  zonal winds (U-component winds) and sea-level topography; 3) Outgoing longwave radiation
  (OLR); and 4) Southern oscillation index (SOI). Reports were written monthly from
  January 2004 through October 2009 with annually summaries for 2003-2008. As of the
  October 2009 report, NCDC no longer wrote a separate assessment of the current state
  of El Niu00c3u00b1o/Southern Oscillation as part of its monthly climate report.
  The information is incorporated in the El Niu00c3u00b1o Diagnostic Discussion produced
  each month by the NOAA Climate Prediction Center.\",\n\t\"license_title\": null,\n\t\"extras\":
