  \"[\"How to cite: A suggested citation is provided at the bottom of each online
  report. Users should modify according to their writing style.\", \"Please note that
  State of the Climate reports are based upon operational datasets. The official operational
  datasets chosen for the report can and do change over time. The nature of these
  changes can be evolutionary, such as addition of previously-missing data or changes
  due to quality-assurance algorithms. Changes may also be revolutionary, in that
  a new version of an operational dataset, or a different dataset altogether, are
  adopted for official use. In any of these cases, the values presented in the State
  of the Climate reports reflect those known at the time, using the official dataset
  at the time. Values are not updated or edited within past reports, unless otherwise
  noted, even if the underlying official dataset has since changed.\"]\"\n\t},\n\t{\n\t\t\"key\":
